window.bookSummaryJSON = "<p>My secret is out.</p> <p>Everyone knows who I am. I don't have to hide. That should be a relief. Instead, it brings new problems.</p> <p>Things went fast, and people got killed. Now I need to rescue my best friend.</p> <p>We're going into the Dark-World. We're going to get her back. And I don't care who stands in my way. If I need to, I will go through them.</p> <p>She's my family, they are my family. Nobody touches my family.</p> <p>I will save her and my world. I'm Isadora Seraphina Savill Royal. I'm a full-blood witch and protector. Now I'll be a saviour.</p> <p>Contains mature themes.</p>"; 
